import { Route, BrowserRouter as Router, Routes } from "react-router-dom";
import "./App.css";
import Navbar from "./components/Navbar";
import Home from "./pages/home";
import MealDetails from "./components/details";
import { RecipesProvider } from "./services/Context";


function App() {
  return (
    <RecipesProvider>
    <Router> {/* Cambiamos a BrowserRouter */}
      <div className="App">
        <Navbar />

        <Routes>

            <Route path="/" element={<Home />} />

            <Route path="/details/:mealId" element={<MealDetails />} />

        </Routes>
      </div>
    </Router>
    </RecipesProvider>
  );
}

export default App;
